    <div>
      <h2>Item Details:</h2>
      <p>Name: {item.item_name}</p>
      <p>Size: {item.size}</p>
      <p>Animal: {item.animal}</p>
      <p>Category: {item.category}</p>
      {/* Add any other properties you want to display */}
    </div>
  );
}

